import React from 'react';
import { useParams } from 'react-router-dom';
import ChatRoom from "../components/ChatRoom/ChatRoom";

const chatRoom = () => {
    const { roomId } = useParams();
    return (
        <div>
            <h1>채팅방 페이지 입니다</h1>
            <ChatRoom/>
        </div>
    );
};

export default chatRoom;
